import './App.css';

function login() {
  return (
    <div className="login">
      <header className="App-header">
        <h1>Login</h1>
        <p>Name <input></input></p>
        <p>Email <input></input></p>
        <p>Password <input></input></p>
        <button>Login</button>

        
      </header>
    </div>
  );
}

export default login;
